import { Row, Col } from 'antd';

const DashboardLayout = props => {
 return (
     <div className="layout">
         <Row>
            <Col style={{position: 'static', height: '100vh'}} span={4}>{props.sidebar}</Col>
             <Col span={20}>{props.children}</Col>
         </Row>

        <style jsx>{`
            .layout {
                position: relative;
                min-height: 100vh;
            }

            .layout-body {
                position: relative;
            }
        `}</style>
     </div>
 )
}

export default DashboardLayout
